import './Form.scss';
import React from 'react';
import Button from '../button/Button';

function Form({title, question, answer}){

  const buttonNumber = [0,1,2,3,4,5,7,8,9,10];

    return (
      <>
        <form className ="text-form-container">
          <div className="text-form">
            <h1 className="title-form">{title}</h1>
              <p>{question}</p> 
              <p>{answer}</p>
              {buttonNumber.map((number)=>{
                <Button nameBtn={number} className="buttonWhite"/>
              })}                           
          </div>           
        </form>
      </>
    );
  };
  export default Form;
